import './App.css';

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

const App = () => {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/student/getresume/:role" element={<GetResume />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
